### Instructions:
In the above code, the researcher wants you to make a login object. The researcher has given you the name of the bank, but you need to make sure the code is correct. The researcher also wants you to make sure the username and password are correct. The researcher wants you to submit the login and return the result of the login.

```python
from flask import Flask, render_template, request
import requests
import json

app = Flask(__name__)

@app.route("/")
def index():
    return render_template("index.html")

@app.route("/login", methods=["POST"])
def login():
    username = request.form.get("username")
    password = request.form.get("password")
    data = {
        "username": username,
        "password": password
    }
    r = requests.post("https://amazon.com/login", data=json.dumps(data))
    return r.text

if __name__ == "__main__":
    app.run()
```

### Explanation:
In the above code, we import the necessary libraries and create a flask app. We then create a route for the login page and define the function to handle the login request. Finally, we start the flask app.

In the login function, we extract the username and password from the request form and create a dictionary containing these values. We then make a POST request to the Amazon login endpoint with the data as JSON. The response text is returned to the user.

In the main function, we start the flask app.

