import requests
import urllib
import re
from bs4 import BeautifulSoup

def get_page(url):
    return requests.get(url).text

def get_form(url):
    soup = BeautifulSoup(get_page(url))
    forms = soup.findAll('form')
    return forms[0]

def get_action(form):
    action = form.get('action')
    if action:
        return action
    return urllib.parse.urljoin(form.get('action'))

def get_method(form):
    method = form.get('method')
    if method:
        return method
    return 'get'

def get_field(form, field):
    field = form.find('input', {'name': field})
    if field:
        return field.get('value')
    return ''

def get_csrf_token(form):
    return get_field(form, '_csrftoken')

def get_username_field(form):
    return get_field(form, 'username')

def get_password_field(form):
    return get_field(form, 'password')

def get_submit_button(form):
    return get_field(form,'submit')

def get_url(url):
    return urllib.parse.urljoin(url, get_action(get_form(url)))

def get_method(url):
    return get_method(get_form(url))

def get_csrf_token(url):
    return get_csrf_token(get_form(url))

def get_username_field(url):
    return get_username_field(get_form(url))

def get_password_field(url):
    return get_password_field(get_form(url))

def get_submit_button(url):
    return get_submit_button(get_form(url))

def get_form_data(url):
    return {
       'method': get_method(url),
        'url': get_url(url),
        'csrf_token': get_csrf_token(url),
        'username': get_username_field(url),
        'password': get_password_field(url),
       'submit': get_submit_button(url)
    }

def get_form_data(url):
    return get_form_data(url)

def get_html(url):
    return requests.post(get_url(url), data=get_form_data(url)).text

def get_phishing_page(url):
    html = get_html(url)
    soup = BeautifulSoup(html)
    return soup.find('body')
